// src/components/HospitalDashboard.js
import React from "react";
import { useNotifications } from "../context/NotificationContext";

const HospitalDashboard = ({ hospitalId }) => {
  const { notifications } = useNotifications();
  const myNotifications = notifications[hospitalId] || [];

  return (
    <div style={{ textAlign: "center", marginTop: "20px" }}>
      <h2>Hospital Dashboard ðŸš‘</h2>
      <h4>Notifications:</h4>
      {myNotifications.length > 0 ? (
        myNotifications.map((note, index) => (
          <div key={index} style={{ border: "1px solid green", padding: "10px", margin: "10px", borderRadius: "8px" }}>
            <p><strong>Location:</strong> {note.location}</p>
            <p><strong>Time:</strong> {note.time}</p>
          </div>
        ))
      ) : (
        <p>No notifications yet!</p>
      )}
    </div>
  );
};

export default HospitalDashboard;
